function bubbleSort(cadastros){
    for(var i = 0; i < cadastros.length; i++){
        for(var j = 0; j < (cadastros.length - i - 1); j++){
            if(cadastros[j].identificacao_do_numero_da_expedicao < cadastros[j + 1].identificacao_do_numero_da_expedicao){
                var auxiliar = cadastros[j]
                cadastros[j] = cadastros[j + 1]
                cadastros[j + 1] = auxiliar
              }
        }
    }
    console.log(cadastros);
    
    cadastros.forEach((cadastro) => {
        conteudo += `
        <div class="container">
             <div class="row">
                 <div class="col-md-8">
                     <div class="feed">
                         <ul id="lista">
                             <p> ${cadastro.nome_do_aluno_diplomado}</p>
                             <p> ${cadastro.identificacao_do_numero_da_expedicao}</p>
                         </ul>
                     </div>
                 </div>
             </div>
        </div>
        
        `;
    });

    lista.innerHTML = conteudo;
}

function insertionSort(cadastros)
{
    for (let i = 1; i < cadastros.length; i++){
        let key = cadastros[i];
        let j = i-1;
      
        while (j >= 0 && cadastros[j].identificacao_do_numero_da_expedicao > key.identificacao_do_numero_da_expedicao){
            cadastros[j+1] = cadastros[j];
            j = j-1;
        }

        cadastros[j+1] = key;
    }
    console.log(cadastros);

    cadastros.forEach((cadastro) => {
        conteudo += `
        <div class="container">
             <div class="row">
                 <div class="col-md-8">
                     <div class="feed">
                         <ul id="lista">
                             <p> ${cadastro.nome_do_aluno_diplomado}</p>
                             <p> ${cadastro.identificacao_do_numero_da_expedicao}</p>
                         </ul>
                     </div>
                 </div>
             </div>
        </div>
        
        `;
    });

    lista.innerHTML = conteudo;
}



